<style>:root{--bg:#0b0f14;--card:#111826;--txt:#e8eef7;--muted:#a7b4c6;--accent:#ff3b30;--accent2:#ffd24a}
body{margin:0;font-family:system-ui; background:#0b0f14;color:var(--txt)}
.wrap{min-height:100vh;display:grid;place-items:center;padding:28px}
.card{width:min(720px,100%);background:rgba(255,255,255,.04);border:1px solid rgba(255,255,255,.1);border-radius:20px;padding:28px}
.brand{display:flex;gap:14px;align-items:center}
.logo{width:56px;height:56px;border-radius:16px;background:linear-gradient(135deg,var(--accent),#b400ff);display:grid;place-items:center;overflow:hidden}
.logo img{width:100%;height:100%;object-fit:cover;display:block}
.chips{display:flex;gap:10px;flex-wrap:wrap;margin:18px 0}
.chip{padding:10px 12px;border-radius:999px;background:rgba(255,255,255,.06);border:1px solid rgba(255,255,255,.1)}
.grid{display:grid;gap:12px}
a.btn{display:flex;justify-content:center;padding:14px;border-radius:14px;color:var(--txt);text-decoration:none;background:rgba(255,255,255,.05)}
a.primary{background:linear-gradient(135deg,var(--accent),#ff7a59)}
a.secondary{background:linear-gradient(135deg,#1b6dff,#34d0ff)}
a.gold{background:linear-gradient(135deg,var(--accent2),#ff8a00);color:#111}
h1{margin:0;font-size:28px;line-height:1.2}
.tag{margin:6px 0 0;color:var(--muted);font-size:14.5px}
.person{margin:6px 0 0;color:var(--txt);font-size:16px;font-weight:600} .person span{font-weight:500;color:var(--muted);font-size:14px}
</style>
